import React from 'react';
import styled, {css} from 'styled-components';


const Wrapper = styled.div`

    padding: 8% 2% 8% 2%;
    `;

const ColorBack = (props) =>(
    <Wrapper style={"background-color:"+props.color}>
        {props.children}
    </Wrapper>
    )

export default ColorBack;
